import React from 'react';
import { BrowserRouter as Router, Route,Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css"

import Navbar from './components/layout/Navbar';
import Landing from './components/layout/Landing';
import Register from './components/auth/Register';
import Login from './components/auth/Login';
import Vendor from './components/vendor/vendorInfo';
import Order from './components/student/order';
import Create from './components/vendor/create-product';
import View from './components/vendor/view-product';
import Ready from './components/vendor/rtodis-product';
import Dispatched from './components/vendor/dis-product';

function App() {
  return (
    // <Provider store={store}>
      <Router>
       <div className="container">
          <Navbar />
          <Route path="/" component={Landing} />
          <Route path="/register" component = {Register} />
          <Route path="/login" component={Login} />
          <Route path="/vendor/:id" component={Vendor}/>
          <Route path="/student/:id" component={Order}/>
          <Route path="/vendor/:id/create" component={Create}/>
          <Route path="/vendor/:id/view" component={View}/>
          <Route path="/vendor/:id/ready" component={Ready}/>
          <Route path="/vendor/:id/dispatched" component={Dispatched}/>
        </div>
      </Router>
    // </Provider>
  );
}

export default App;
